canonical_solution:
class Solution:
    def findHighAccessEmployees(self, access_times: List[List[str]]) -> List[str]:
        d = defaultdict(list)
        for name, t in access_times:
            d[name].append(int(t[:2]) * 60 + int(t[2:]))
        ans = []
        for name, ts in d.items():
            ts.sort()
            if any(ts[i] - ts[i - 2] < 60 for i in range(2, len(ts))):
                ans.append(name)
        return ans

inefficient_solution:
class Solution:
    def findHighAccessEmployees(self, access_times: List[List[str]]) -> List[str]:
        d = {}
        for name, t in access_times:
            if name not in d:
                d[name] = []
            d[name].append((int(t[:2]) * 60 + int(t[2:]),))

        ans = []
        for name, ts in d.items():
            ts.sort()
            if name not in d:
                d[name] = []
            d[name].append(ts[-1] + 60 * 24)
            if any(x - y < 60 for x, y in zip(d[name][1:-1], d[name][:-2])):
                ans.append(name)
        return ans
